#include&lt;stdio.h&gt;

void main() {
    int i, j;
    printf(&#34;输入两个数:&#34;);
    scanf(&#34;%d %d&#34;,&amp;i,&amp;j);
    if (i * j == 1) {
        printf(&#34;山本我日你先人&#34;);
    }
    else
        printf(&#34;我不会算&#34;);
}

